/**
 * This function is based on code from https://oli.me.uk/2013/06/08/searching-javascript-arrays-with-a-binary-search/
 *
 * @param  Object searchElement the element to search for
 * @param  Function comparator    function that compares two objects, if first
 * is larger then it should return 1, if second argument is larger then it should
 * return -1. Returns 0 if the two objects are equal
 * @return Number               the index of the found object or negative value if not found
 */

function binaryIndexOf(searchElement, comparator) {
  'use strict';

  var minIndex = 0;
  var maxIndex = postalCodes.length - 1;
  var currentIndex;
  var currentElement;
  var resultIndex;

  while (minIndex <= maxIndex) {
    resultIndex = currentIndex = (minIndex + maxIndex) / 2 | 0;
    currentElement = postalCodes[currentIndex];

    if (comparator(currentElement, searchElement)<0) {
      minIndex = currentIndex + 1;
    }
    else if (comparator(currentElement, searchElement)>0) { 
      maxIndex = currentIndex - 1;
    }
    else {
      return currentIndex;
    }
  }

  return ~maxIndex;
}

Array.prototype.binaryIndexOf = binaryIndexOf;


