var inputPost = document.getElementById("post_number");
var inputSted = document.getElementById("sted");

/**
 * @brief function that compares two objects. 
 * @param type current the number to be compared.
 * @param type search the number to be compared with.
 * @return if first is larger then it should return 1, 
 *         if second argument is larger then it should
 *         return -1. Returns 0 if the two objects are equal.
 */
function comparePost(current, search){
    if (current["nr"] < search){
        return -1;
    }
    if (current["nr"] > search){
        return 1;
    }
    return 0;
}

/**
 * @brief get location at given postalcode and reolve or reject based on validity. 
 * @param type num is the postcode to be searched.
 * @return promise that is either resolve or reject.
 */

function postCodeNr(num){
    return new Promise(function(resolve,reject){
        console.log(num)
        var codeArray = postalCodes.binaryIndexOf(num, comparePost); // getting the index from binaryIndexOf() for postalCodes array. 
        console.log("codeArray"+ codeArray)
        if(codeArray > 0){
            resolve(postalCodes[codeArray].sted);
        }else{
            throw("Dette postnummeret finnes ikke");
        }
    });
}
