var inputGate = document.getElementById("gate");
var stedOutput = document.getElementById("sted");
var nrOutput = document.getElementById("gate_nr");
var postNrOutput = document.getElementById("post_number");
var gateListe = document.getElementById("gater");

/**
 * @brief sends the http request and that fetch the Json. 
 * @param gateNavn is a part of the url. 
 * @return it returns a promise that is either resolved or rejected. 
 */
function httpRequest(gateNavn){
    return new Promise(function(resolve, reject){
        if(gateNavn != ""){
            setTimeout(function(){ 
            fetch('http://folk.ntnu.no/oeivindk/imt1441/sok.php?q=' + gateNavn)
            .then(response => response.json())
            .then(json => resolve(json))
            .catch(error => reject(error)) 
            }, 300); // fetch the Json after 300ms. 
        }
    })
}

inputGate.addEventListener("keyup", setValueOnHtml); // setValueonHtml runs when user has stop writing in inputGate. 
inputGate.addEventListener("blur", setValueOnHtml); // setValueOnHtml runs when inputGate has lost the focus. 

/**
 * @brief gets the promise if promise is resolved then it process Json
 *        or if its rejected then it log the error and empty all the fields. 
 */
function setValueOnHtml(){
    httpRequest(inputGate.value).then(function(myJson){
        myJson.forEach(obj=>{
            // Clears the list
            while (gateListe.firstChild){
                gateListe.removeChild(gateListe.firstChild);
            }
            // loops through nr in obj 
            for (var z = 0; z < obj.nr.length; z++){
                if(z < 10){
                    var string = obj.gate; 
                    string = string + ", " + obj.nr[z] + ", " + obj.postnr + ", " + obj.sted; // building a string for option list.
                    var option = document.createElement("option"); //  creating option list of adresses for users.
                    option.value = string;
                    gateListe.appendChild(option);
                    string = "";
                }
            }
        })
    }).catch(function(err){
        stedOutput = "";
        nrOutput = "";
        postNrOutput = "";
        console.log(err);
    });
      
};
// function runs everytime when user select one of the adresses from gateListe. 
inputGate.addEventListener("change", function(){
    // temporary variable which gets all splited elementes from inputGate.
    var temp = inputGate.value.split(", "); 
    inputGate.value = temp[0];
    nrOutput.value = temp[1];
    postNrOutput.value = temp[2];
    if(postNrOutput.value.length == 4){
        getLocation();
    }
});